import React,{Component} from 'react';
import { Table } from 'react-bootstrap';

export class Student extends Component{



    render(){
        return(

            <div>
                <p id="before-table"></p>
               <table className="table table-bordered" id="dataTable">
                <thead>
                    <tr>
                <th>ID</th>
                <th>First Name</th>
                <th>Last Name</th>
                <th>Email</th>
                <th>Course</th>

                </tr>
                </thead>
                <tbody>
                    
                </tbody>
                </table>
            </div>
        )
    }
}
